import styles from './Home.module.css';

function Home() {
  return (
    <section>
      <h1>Vagas de emprego</h1>
      <p>Confira os benefícios e nos envie seu currículo</p>
      <a href="/">Ver oportunidades</a>
    </section>
  );
}

export default Home;
